import React, { useState, useRef } from 'react';
import './Service.css'; // Your CSS file for styling
import SearchResults from './SearchResults';
import { searchResultsData } from './searchResultsData'; // Import your data file

const Service = () => {
  // Define your options for each category (locations, ageRanges, serviceTypes)...

  const [selectedLocations, setSelectedLocations] = useState(null);
  const [selectedAgeRange, setSelectedAgeRange] = useState(null);
  const [selectedServiceType, setSelectedServiceType] = useState(null);
  const [searchResults, setSearchResults] = useState(null);

  // Function to handle click on location option
  const handleLocationClick = (id) => {
    setSelectedLocations(id === selectedLocations ? null : id);
  };

  // Function to handle click on age range option
  const handleAgeRangeClick = (id) => {
    setSelectedAgeRange(id === selectedAgeRange ? null : id);
  };

  // Function to handle click on service type option
  const handleServiceTypeClick = (id) => {
    setSelectedServiceType(id === selectedServiceType ? null : id);
  };

  // Function to scroll to search results
  const scrollToSearchResults = () => {
    const searchResultsElement = document.getElementById('search-results');
    if (searchResultsElement) {
      searchResultsElement.scrollIntoView({ behavior: 'smooth' });
    }
  };

  // Function to handle GO button click
  const handleGoButtonClick = () => {
    if (selectedLocations !== null && selectedAgeRange !== null && selectedServiceType !== null) {
      // Simulate fetching results based on selections
      const results = searchResultsData.filter(result =>
        result.title === 'Schermerhorn Program' && selectedLocations === 3 && selectedAgeRange === 2 && selectedServiceType === 1
      );

      setSearchResults(results.length > 0 ? results : 'not found');

      // Scroll to search results
      scrollToSearchResults();
    }
  };

  // JSX for rendering options and search results
  return (
    <div className="service-page">
      <h2>Search Options</h2>

      {/* Locations */}
      <div className="category">
        <h3>Locations</h3>
        <div className="options-row">
          {/* Render location options */}
          {locations.map((location) => (
            <div
              key={location.id}
              className={`option-block ${selectedLocations === location.id ? 'selected' : ''}`}
              onClick={() => handleLocationClick(location.id)}
            >
              <img src={location.image} alt={location.text} className="option-image" />
              <p className="option-text">{location.text}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Age Ranges */}
      <div className="category">
        <h3>Age ranges</h3>
        <div className="options-row">
          {/* Render age range options */}
          {ageRanges.map((ageRange) => (
            <div
              key={ageRange.id}
              className={`option-block ${selectedAgeRange === ageRange.id ? 'selected' : ''}`}
              onClick={() => handleAgeRangeClick(ageRange.id)}
            >
              <img src={ageRange.image} alt={ageRange.text} className="option-image" />
              <p className="option-text">{ageRange.text}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Service Types */}
      <div className="category">
        <h3>Service types</h3>
        <div className="options-row">
          {/* Render service type options */}
          {serviceTypes.map((serviceType) => (
            <div
              key={serviceType.id}
              className={`option-block ${selectedServiceType === serviceType.id ? 'selected' : ''}`}
              onClick={() => handleServiceTypeClick(serviceType.id)}
            >
              <img src={serviceType.image} alt={serviceType.text} className="option-image" />
              <p className="option-text">{serviceType.text}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Render GO button conditionally */}
      {selectedLocations !== null && selectedAgeRange !== null && selectedServiceType !== null && (
        <button className="go-button" onClick={handleGoButtonClick}>GO</button>
      )}

      {/* Render search results using the SearchResults component */}
      {searchResults !== null && (
        <div id="search-results" className="search-results">
          <h2>Search Results</h2>
          {/* Render search results */}
          {searchResults === 'not found' ? (
            <div>No results found.</div>
          ) : (
            searchResults.map((result) => (
              <div key={result.id} className="result-card">
                <img src={result.image} alt={result.title} className="result-image" />
                <div className="result-details">
                  <h3 className="result-title">{result.title}</h3>
                  <p className="result-description">{result.description}</p>
                  <a href={result.link} className="result-link">Learn more</a>
                </div>
              </div>
            ))
          )}
        </div>
      )}
    </div>
  );
};

export default Service;
